(function () {
  'use strict';

  const carsJSON = `[
  {
    "year": 2000,
    "make": "Honda",
    "model": "Accord",
    "price": 2800
  },
  {
    "make": "Nissan",
    "model": "Leaf",
    "year": 2012,
    "price": 1800
  },
  {
    "make": "Ford",
    "model": "F150",
    "year": 2009,
    "price": 1950
  },
  {
    "make": "Chevrolet",
    "model": "Trailblazer",
    "year": 2009,
    "price": 1550
  },
  {
    "make": "Honda",
    "model": "Pilot",
    "year": 2003,
    "price": 2200
  }
]`;
  const cars = JSON.parse(carsJSON);

  const getCars = () => new Promise(resolve => {
    setTimeout(() => resolve(cars), 2000);
  });

  const formatCar = car => {
    const {
      year,
      make,
      model,
      price
    } = car;

    return `${year} ${make} ${model}: $${price}`;
  };

  const generateReport = (cars, maxPrice) =>
    cars
      .filter(car => car.price < maxPrice)
      .map(formatCar)
      .join('\n');

  document.getElementById('message-element').textContent = 'Loading...';

  getCars().then(cars => {
    const message = generateReport(cars, 2000);
    document.getElementById('message-element').textContent = message;
  });

}());

